    (ROV) outfitted with video equipment (and other devices) was deployed fromthe NOAA
    Ship McAurthurII (AR04-04) in an attempt to document the presence of critical hard
    bottom benthic habitats believedto exist in the waters of the Olympic Coast national
    marine sanctuary (OCNMS). Video data from specific dives falling withinthe bounds
    of the HMPR-113-2004-01d survey area were reviewed to examine the benthic characteristics
    as a tool for validatingsonar imagery.",nt"license_title": null,nt"extras":
